(1, 'weixin01', 3, 10, 100, '本会员卡随时可用，在特定的情况下使用本卡可以打折、优惠。本卡的最终解释权归AI9所有。', '100积分可以替代AI9微信1元代金券，本活动永久有效。', 1380890155),
(2, 'qgemsk1383550186', 15, 127, 127, '<p>\r\n	会员卡只能在本公司（苏州翼企网络）使用，持有会员卡的客户可享受公司的活动产品的价格优惠，享受公司的金牌服务！\r\n</p>\r\n<p>\r\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 本会员卡最终解释权归 苏州翼企网络科技有限公司 所有\r\n</p>', '<p>\r\n	积分可兑换会员使用级别，600积分兑换从vip1升级为vip2；依次类推\r\n</p>\r\n<p>\r\n	900积分兑换vip3；1200积分兑换vip4；1500积分兑换vip5;2000积分兑换vip6（最高级别可以开通所有功能）成为至尊vip会员！\r\n</p>', 1383663656);
