(1, 1, 1, '功能介绍', 680, 680680, 0, '', 'weixin01', '自动回复', 3, 'http://img0.bdstatic.com/img/image/search/zhuangnvlang_200x66.jpg', 0, 0, 0, 0, 1381886961),
(2, 4, 1, '哈灵V6 立体声蓝牙耳机', 80, 125, 6.4, '<p align=\\"center\\" style=\\"color:#404040;font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\\">\r\n	<strong>哈灵V6立体声蓝牙耳机原装正品一拖二</strong>\r\n</p>\r\n<p align=\\"center\\" style=\\"color:#404040;font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\\">\r\n	<strong>苹果5 iphone4s蓝牙耳机三星 HTC 小米通用 双待机 一拖二</strong>\r\n</p>\r\n<p align=\\"center\\" style=\\"color:#404040;font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\\">\r\n	授权代理，售后无忧！强大售后服务，7天无理由退货，15天包换，超长3年保修！！！\r\n</p>\r\n<p align=\\"center\\" style=\\"color:#404040;font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\\">\r\n	<img align=\\"middle\\" src=\\"http://img.yi66.net/v6/1.png\\" />\r\n</p>\r\n<p align=\\"center\\" style=\\"color:#404040;font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\\">\r\n	<strong>大客户批发热线电话：白天【18036739005】 晚上【13295218495】QQ：715457186</strong>\r\n</p>\r\n<p align=\\"center\\" style=\\"color:#404040;font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\\">\r\n	<img align=\\"middle\\" src=\\"http://img.yi66.net/v6/2.jpg\\" /><img align=\\"middle\\" src=\\"http://img.yi66.net/v6/3.jpg\\" />\r\n</p>\r\n<p align=\\"left\\" style=\\"color:#404040;font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\\">\r\n	官方配置：蓝牙主机+副耳机线+USB充电器+USB充电线+领夹+耳挂+说明书+礼品包装&nbsp;&nbsp;\r\n</p>\r\n<p align=\\"left\\" style=\\"color:#404040;font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\\">\r\n	精英配置：蓝牙主机+副耳机线+USB充电器+USB充电线+领夹+耳挂+说明书+礼品包装+车载充电器\r\n</p>\r\n<p align=\\"left\\" style=\\"color:#404040;font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\\">\r\n	至尊配置：蓝牙主机+副耳机线+USB充电器+USB充电线+领夹+耳挂+说明书+礼品包装+蓝牙适配器&nbsp;\r\n</p>\r\n<p align=\\"left\\" style=\\"color:#404040;font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\\">\r\n	旗舰配置：蓝牙主机+副耳机线+USB充电器+USB充电线+领夹+耳挂+说明书+礼品包装+车充充电器+蓝牙适配器\r\n</p>\r\n<p align=\\"left\\" style=\\"color:#404040;font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\\">\r\n	车充套餐：方便蓝牙耳机在汽车上充电<br />\r\n蓝牙适配器：把蓝牙适配器插在电脑的USB口，可以让蓝牙耳机当电脑的无线耳机。\r\n</p>\r\n<p align=\\"left\\" style=\\"color:#404040;font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\\">\r\n	配对方法：在蓝牙耳机关机的状态，一直按开机键，刚开始是蓝灯闪，不要放手，直到指示灯红蓝交替闪烁（蓝灯慢慢一闪一闪是不对的）,放手，这个过程大概是8-10秒。这时才可以用手机蓝牙搜索并配对.\r\n</p>\r\n<p align=\\"left\\" style=\\"color:#404040;font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\\">\r\n	<img align=\\"middle\\" src=\\"http://img.yi66.net/v6/4.jpg\\" />\r\n</p>\r\n<p align=\\"left\\" style=\\"color:#404040;font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\\">\r\n	<img align=\\"middle\\" src=\\"http://img.yi66.net/v6/5.jpg\\" />\r\n</p>', 'qgemsk1383550186', '哈灵耳机', 29, 'http://gd4.alicdn.com/bao/uploaded/i4/16401022165690097/T1BSCmXBlbXXXXXXXX_!!0-item_pic.jpg', 0, 0, 0, 0, 1383641804),
(3, 8388607, 1, '手机订餐系统源码 外卖订餐系统', 38, 98, 3.9, '本套源码安装演示地址：http://can.fjd100.com/<br />\r\n<p>\r\n	<img src="http://www.hen-feng.com/tu/din.jpg" /> \r\n</p>\r\n<br />\r\n<p>\r\n	复制到浏览器打开，推荐使用浏览器IE8以上或者谷歌浏览器浏览 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;\r\n</p>\r\n<p>\r\n	手机或者平板浏览效果的请扫描下面的二维码 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;\r\n</p>\r\n<p>\r\n	&nbsp; \r\n1、微信接入 &nbsp; 2、手机浏览器接入 &nbsp;&nbsp;\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p style="\\" \\\\"\\\\\\\\"color:#404040;font-family:tahoma,\\\\"\\""="" arial,="\\" \\\\"\\\\"\\""="" 宋体,="\\" sans-serif;font-size:14px;background-color:#ffffff;\\\\\\\\\\\\\\"="\\"> <img src="http://imgs.yi66.net/tao/tuan/f.jpg" style="width:216px;height:202px;" /><img src="http://imgs.yi66.net/tao/tuan/%E4%B8%BB.jpg" width="\\" \\\\"\\\\\\\\"472\\\\\\\\"\\\\"\\""="" height="\\" \\\\"\\\\\\\\"555\\\\\\\\"\\\\"\\""="" style="width:186px;height:207px;"><img src="http://imgs.yi66.net/tao/tuan/can.png" width="\\" \\\\"\\\\\\\\"249\\\\\\\\"\\\\"\\""="" height="\\" \\\\"\\\\\\\\"256\\\\\\\\"\\\\"\\""="" style="width:187px;height:194px;">\r\n	</p>\r\n<p style="\\" \\\\"\\\\\\\\"color:#404040;font-family:tahoma,\\\\"\\""="" arial,="\\" \\\\"\\\\"\\""="" 宋体,="\\" sans-serif;font-size:14px;background-color:#ffffff;\\\\\\\\\\\\\\"="\\"><br />\r\n</p>\r\n<p style="\\" \\\\"\\\\\\\\"color:#404040;font-family:tahoma,\\\\"\\""="" arial,="\\" \\\\"\\\\"\\""="" 宋体,="\\" sans-serif;font-size:14px;background-color:#ffffff;\\\\\\\\\\\\\\"="\\">\r\n		----------------------------------------\r\n	</p>\r\n<p style="\\" \\\\"\\\\\\\\"color:#404040;font-family:tahoma,\\\\"\\""="" arial,="\\" \\\\"\\\\"\\""="" 宋体,="\\" sans-serif;font-size:14px;background-color:#ffffff;\\\\\\\\\\\\\\"="\\">\r\n		&nbsp;<strong>微信订餐系统-微信Html5订餐模板</strong> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>', 'qgemsk1383550186', '手机订餐系统 外卖订餐', 13, 'http://www.hen-feng.com/tu/din.jpg', 0, 1, 1385827199, 15, 1383643273),
(4, 8388607, 1, '团购抵金券', 10, 100, 1, '团购抵金券活动开始了', 'kuuqya1383708897', '团购', 1, 'http://t11.baidu.com/it/u=35007309,46119997&fm=23&gp=0.jpg', 0, 1, 1384617599, 10, 1383710252),
(5, 6, 1, '香味红烧鱼', 48, 58, 8.3, '<p style="vertical-align:baseline;font-family:''Roboto Condensed'', sans-serif;font-size:16px;color:#666666;background-color:#F0F0F0;">\r\n	红烧鱼都有哪些营养价值：\r\n</p>\r\n<p style="vertical-align:baseline;font-family:''Roboto Condensed'', sans-serif;font-size:16px;color:#666666;background-color:#F0F0F0;">\r\n	1.含有丰富的完全蛋白质。鱼肉含有大量的蛋白质，如黄鱼含17.6%、带鱼含18.1%、鲐鱼含21.4%、鲢鱼含18.6%、<a href="http://yangsheng.hebnews.cn/yinshi/liyu/" target="_blank">鲤鱼</a>含17.3%、鲫鱼含13%。鱼肉所含的蛋白质都是完全蛋白质，而且蛋白质所含必须<a href="http://yangsheng.hebnews.cn/xiyi/anjis/" target="_blank">氨基酸</a>的量和比值最适合人体需要，容易被人体消化吸收。\r\n</p>\r\n<p style="vertical-align:baseline;font-family:''Roboto Condensed'', sans-serif;font-size:16px;color:#666666;background-color:#F0F0F0;">\r\n	2.脂肪含量较低，且多为不饱和脂肪酸。鱼肉的脂肪含量一般比较低，大多数只有1%–4%，如黄鱼含0.8%、带鱼含3.8%、鲐鱼含4%、鲢鱼含4.3%、鲤鱼含5%鲫鱼含1.1%鳙鱼（胖头鱼）只含0.9%、墨斗鱼只含0.7%。鱼肉的脂肪多由不饱和脂肪酸组成，不饱和脂肪酸的碳链较长，具有降低<a href="http://yangsheng.hebnews.cn/renqun/danguchun/" target="_blank">胆固醇</a>的作用。\r\n</p>\r\n<p style="vertical-align:baseline;font-family:''Roboto Condensed'', sans-serif;font-size:16px;color:#666666;background-color:#F0F0F0;">\r\n	3.无机盐、维生素含量较高。海水鱼和淡水鱼都含有丰富的磺，还含有磷、钙、铁等无机盐。鱼肉还含有大量的维生素A、维生素D、维生素B1、尼克酸。这些都是人体需要的营养素。\r\n</p>', 'qgemsk1383550186', '红烧鱼', 0, 'http://cans.fjd100.com/wp-content/uploads/2013/10/7-480x317.jpg', 1, 0, 0, 0, 1385621502),
(8, 7, 1, '海鲜双飞', 78, 108, 7.2, '鲜海参的做法大全，海参又名刺参、海鼠、海瓜，是一种名贵海产动物，因补益作用类似人参而得名。海参和鲍鱼一样，分为新鲜海参和干海参，新鲜海参比较方便，味道也比较鲜美，营养价值丰富。', 'qgemsk1383550186', '海鲜', 2, 'http://cans.fjd100.com/wp-content/uploads/2013/10/44.jpg', 1, 0, 0, 0, 1385621712),
(9, 6, 1, '砂锅红烧肉', 68, 88, 7.7, '<p style="vertical-align:baseline;font-family:''Roboto Condensed'', sans-serif;font-size:16px;color:#666666;background-color:#F0F0F0;">\r\n	1.胡萝卜茭白切滚刀块备用。姜蒜切片\r\n</p>\r\n<p style="vertical-align:baseline;font-family:''Roboto Condensed'', sans-serif;font-size:16px;color:#666666;background-color:#F0F0F0;">\r\n	2.将五花肉和少许姜片下入清水锅中，煮开之后继续煮两三分钟，将肉捞起冲水，沥干后切方块(五花肉也可以切块之后再焯水，随便了，都行的，就是五花肉块得切大一些，太小块炖了之后都没什么口感了)\r\n</p>\r\n<p style="vertical-align:baseline;font-family:''Roboto Condensed'', sans-serif;font-size:16px;color:#666666;background-color:#F0F0F0;">\r\n	3.将五花肉块下入锅中（锅子里不放油），小火煎至表面变黄，将油煎出一部分\r\n</p>', 'qgemsk1383550186', '红烧肉', 0, 'http://cans.fjd100.com/wp-content/uploads/2013/10/33.jpg', 1, 0, 0, 0, 1385621849),
(7, 7, 1, '香飘四溢', 38, 48, 7.9, '<p style="vertical-align:baseline;font-family:''Roboto Condensed'', sans-serif;font-size:16px;color:#666666;background-color:#F0F0F0;">\r\n	茭白以丰富的营养价值而被誉为“水中参”， 其质地鲜嫩，味甘实，被视为蔬菜中的佳品。茭白味甘、微寒；具有祛热、生津、止渴、利尿、除湿、通利的功效；还有补虚健体以及美容减肥的功效。\r\n</p>\r\n<p style="vertical-align:baseline;font-family:''Roboto Condensed'', sans-serif;font-size:16px;color:#666666;background-color:#F0F0F0;">\r\n	<strong>别名：</strong> \r\n</p>\r\n<p style="vertical-align:baseline;font-family:''Roboto Condensed'', sans-serif;font-size:16px;color:#666666;background-color:#F0F0F0;">\r\n	茭白以丰富的营养价值而被誉为“水中参”，又名茭粑、茭儿菜、篙芭、茭笋、菰笋、茭瓜、茭芦、茭耳菜、绿节。\r\n</p>\r\n<p style="vertical-align:baseline;font-family:''Roboto Condensed'', sans-serif;font-size:16px;color:#666666;background-color:#F0F0F0;">\r\n	<strong>形态特征：</strong> \r\n</p>\r\n<p style="vertical-align:baseline;font-family:''Roboto Condensed'', sans-serif;font-size:16px;color:#666666;background-color:#F0F0F0;">\r\n	古人称茭白为“菰”。在唐代以前，茭白被当作粮食作物栽培，它的种子叫菰米或雕胡，是“六谷”(稌、黍、稷、粱、麦、菰)之一。\r\n</p>\r\n<p style="vertical-align:baseline;font-family:''Roboto Condensed'', sans-serif;font-size:16px;color:#666666;background-color:#F0F0F0;">\r\n	茭白是一种较为常见的水生蔬菜，为禾本科植物菰的嫩茎杆被菰黑粉菌刺激而形成的纺锤形肥大部分。\r\n</p>\r\n<p style="vertical-align:baseline;font-family:''Roboto Condensed'', sans-serif;font-size:16px;color:#666666;background-color:#F0F0F0;">\r\n	茭白食用部分是其花茎基部膨大而成的地下嫩茎。原产我国，生于湖沼水中，全国大部分地区均有栽培，于秋季上市。\r\n</p>\r\n<p style="vertical-align:baseline;font-family:''Roboto Condensed'', sans-serif;font-size:16px;color:#666666;background-color:#F0F0F0;">\r\n	茭白外披绿色叶鞘，内呈三节圆柱状，色黄白或青黄，肉质肥嫩，纤维少，蛋白质含量高。茭白是我国的特产蔬菜，是“江南三大名菜”之一。\r\n</p>\r\n<p style="vertical-align:baseline;font-family:''Roboto Condensed'', sans-serif;font-size:16px;color:#666666;background-color:#F0F0F0;">\r\n	其质地鲜嫩，味甘实，被视为蔬菜中的佳品。\r\n</p>', 'qgemsk1383550186', '炒菜', 0, 'http://cans.fjd100.com/wp-content/uploads/2013/10/8.jpg', 1, 0, 0, 0, 1385621638);
