(4, 'qgemsk1383550186', '蓝牙耳机', '蓝牙耳机是一种基于蓝牙技术的一种小型设备，只需要把这种轻巧的设备藏在耳机边而不需要直接使用通讯设备（手机、电脑等）就可以实现自由通话。蓝牙耳机就是将蓝牙技术应用在免持耳机上，让使用者可以免除恼人电线的牵绊，自在地以各种方式轻松通话。自从蓝牙耳机问世以来，一直是行动商务族提升效率的好工具。蓝牙技术（Bluetooth）让耳机无线化变为可能，包括手机大厂诺基亚（NOKIA）、摩托罗拉（Motorola）、索尼爱立信（SonyEricsson）等，都纷纷推出许多外形五花八门的“蓝牙耳机”，消费者大约花费300元至1000余元不等的代价，就可以让自己变身成“未来战士”。', 0, 'http://gd4.alicdn.com/bao/uploaded/i4/16401022165690097/T1BSCmXBlbXXXXXXXX_!!0-item_pic.jpg', 0, 1383641665),
(5, 'kuuqya1383708897', '团购抵金券', '团购抵金券', 0, 'http://t11.baidu.com/it/u=35007309,46119997&fm=23&gp=0.jpg', 0, 1383710187),
